import classes from './Cart.module.css'

let Cart = ()=>{

let cartItems = [{id: 'c1' ,name: 'Sushi', amount: 2}].map((items) => <ul>{items.name}</ul>)

let cartTotal = [{id: 'c1' ,name: 'Sushi', amount: 2},{id: 'c1' ,name: 'Sushi', amount: 2},{id: 'c1' ,name: 'Sushi', amount: 2}].map((items => {items.amount}))

return(
    <>
    <div className={classes['cart-items']}>
        <ul>
       {cartItems}
       </ul>
    </div>
    <div className={classes.total}>
        {cartTotal}
    </div>
    <div className={classes.actions}>
    <button> Close </button>
    </div>
    </>
)
}

export default Cart
